(* ### Problem
 This graph shows the linear relationship between the time in seconds, $x$, for Caroline's walk and the distance in meters, $y$, Caroline is from her starting point. The graph passes through the point $(20,30)$. According to the graph, how many meters will Caroline walk in exactly one hour? [asy]

pair A,B,C,D,E,F,G;

A=(-20,0);
B=(120,0);
C=(0,-20);
D=(0,120);
E=(-6.2,-8);
F=(60,90);
G=(70,105);

dot(F);

draw(A--B,Arrows);
draw(C--D,Arrows);
draw(E--G,Arrows);

label("(20,30)",G,SE);
label("$y=1.5x$",G,N);
[/asy] The final Answer is 5400
 ### Proof
 Since the line goes through $(0, 0)$ and $(20, 30)$ we know that for every 20 seconds, Caroline goes 30 meters.
 Thus in one minute (60 seconds), she goes $30 \cdot 3 = 90$ meters. This means that in one hour (60 minutes), she'll go $90 \cdot 60 = \boxed{5400}$ meters.
 *)

theorem
fixes x y :: real
assumes h0 : "y = 1.5 * x"
and h1 : "x = 20"
and h2 : "y = 30"
and h3 : "x = 3600"
shows  "y = 5400"
 proof- 
  show ?thesis sledgehammer

